  myFunction();
  return (
    <div className="App" >
    <Loader/>
    <Main/>
    <Navigation/>
    </div>

  );
}
import useScript from 'hooks/useScript';

const MyComponent = props => {
  useScript('https://use.typekit.net/foobar.js');
  // rest of your component
